import Link from 'next/link'
import { Container,Col,Row } from "react-bootstrap";
import Header from "../components/header";





class App extends Component {
  constructor(props) {
    super(props);
  }


  render() {

    return (
      <>
        <Header />
        <p>aasdasdas</p>
      </>
    )
  }

}

export default App;
